import React, { Component } from 'react'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import { LogIn, TeamsList, TeamInsert, TeamsUpdate } from '../pages'
import 'bootstrap/dist/css/bootstrap.min.css'
import NavBar from './NavBar';


class Routes extends Component {
    render() {
        return (
        <Router>
                <style>{'body { background-color: rgba(245, 245, 245, 245); }'}</style>
                <NavBar />
                <Switch>
                    <Route path="/teams" exact component={TeamsList} />
                    <Route path="/teams/create" exact component={TeamInsert} />
                    <Route
                        path="/teams/update/" exact component={TeamsUpdate}
                    />
                    <Route
                        path="/login" exact component={LogIn}
                    />
                </Switch>
         </Router>
        )
    }
}

export default Routes;
